INSERT INTO `kh_vedette` (`id_vedette`, `titre`, `texte`, `image`, `statut`) VALUES
(1, 'NOTRE EQUIPE', 'Des experts en stratégie marketing qui', 'bonhomme1a.png', 0),
(2, 'NOS CLIENTS', 'Des experts en stratégie marketing qui', 'bonhomme2.png', 0),
(3, 'QUI SOMMES NOUS ?', 'Nous sommes des jeunes Camerounais issus d''horizons divers, diplômés en Management, Informatique, Design...Férus d''IT, nous sommes résolus à trouver des solutions innovantes aux problèmes basiques de l''Afrique.', 'bonhomme3.png', 1),
(4, 'QUE FAISONS NOUS ?', 'A travers une visibilité accrue du secteur informel, nous essayons de recréer dans les quartiers une atmosphère de confiance et de solidarité dans la résolution des problèmes quotidiens des populations.', 'bonhomme4.png', 1),
(5, 'POURQUOI LE FAISONS NOUS ?', 'Dans un continent dont l''économie est basée à 95 % sur l''informel, face à un recul du légendaire esprit de solidarité africaine, mûris par nos propres expériences, nous avons pensé qu''il était possible de combler le gap entre le secteur informel, dans toutes ses couches, même les plus reculées, et le digital.', 'bonhomme5.png', 1),
(6, 'ESPACE ABONNEMENT', 'Pour avoir accès aux informations relatives aux quartiers différents du votre ou pour être visibles par les autres quartiers, passez à notre version Premium, vous ne le regretterez jamais !!!', 'bonhomme5.png', 1);
